import "./App.css"

const App = () => {
  return (
    <div className='app-wrapper'>
     <header className='header'>
       <img src = 'https://i.pinimg.com/236x/a7/5c/0d/a75c0da86ac499bc5fb95d2856b2da3c--hot-dudes-som.jpg?nii=t'></img>
       </header>
       <nav className='nav'>
<div className='content'>
  Profile
</div>
<div>
  Mesenges
</div>
       </nav>
       <div>
  Main content
</div>
      </div>
        );
        }

export default App;
